export { Cache } from './cache'
export default new Cache()

import { totalmem } from 'os'

/**
 * Represents an in-memory cache with TTL (Time To Live) support.
 */
export class Cache {
  private cache = new Map<
    string,
    {
      ttl: number
      value: any
    }
  >()

  private maxCacheCap: number

  /**
   * Creates an instance of Cache.
   */
  constructor() {
    this.maxCacheCap = this.calculateMaxCapacity()
  }

  /**
   * Calculates the maximum capacity of the cache based on available system memory.
   * @returns The maximum capacity of the cache.
   */
  private calculateMaxCapacity(): number {
    const totalMemory = totalmem()
    const maxCapacityPercentage = 0.2
    const maxCapacityBytes = totalMemory * maxCapacityPercentage
    return Math.floor(maxCapacityBytes / (1024 * 50))
  }

  /**
   * Retrieves the value associated with the specified key from the cache.
   * @param key - The key to look up in the cache.
   * @returns The cached value if found and not expired; otherwise, returns null.
   */
  get(key: string): any | null {
    const entry = this.cache.get(key)
    if (entry && Date.now() < entry.ttl) {
      return entry.value
    }
    return null
  }

  /**
   * Stores a key-value pair in the cache with a specified TTL (Time To Live).
   * @param key - The key to store in the cache.
   * @param value - The value to associate with the key.
   * @param ttl - The TTL (Time To Live) in seconds for the cached entry.
   */
  set(key: string, value: any, ttl: number): void {
    if (ttl < 1) {
      return
    }

    if (this.cache.size >= this.maxCacheCap) {
      const oldestKey = this.cache.keys().next().value
      this.cache.delete(oldestKey)
    }
    const expireTime = Date.now() + ttl * 1000
    const entry = { value, ttl: expireTime }
    this.cache.set(key, entry)
  }

  /**
   * Removes the entry with the specified key from the cache.
   * @param key - The key to delete from the cache.
   */
  delete(key: string): void {
    this.cache.delete(key)
  }

  /**
   * Checks if the cache contains an entry with the specified key.
   * @param key - The key to check in the cache.
   * @returns True if the cache contains the key; otherwise, false.
   */
  has(key: string): boolean {
    return this.get(key) !== null
  }
}

import { LangKeyType, LanguageEnum } from './language.interface'

/**
 * Represents a set of utility methods for working with languages.
 *
 * @internal
 * @category Internal
 * @class
 */
export class Language {
  /**
   * Parses a language string into its corresponding LanguageEnum value.
   *
   * @param lang The language string to parse, or null/undefined to default to English.
   * @returns The LanguageEnum value corresponding to the provided string, or English if the string is invalid or undefined.
   */
  static parseLang(lang?: string | null): LanguageEnum {
    if (!lang) {
      return LanguageEnum.ENGLISH
    }

    const langKeys = Object.keys(LanguageEnum)
    const matchingKey = langKeys.find(
      (key) => LanguageEnum[key as LangKeyType] === lang,
    )

    return matchingKey
      ? LanguageEnum[matchingKey as LangKeyType]
      : LanguageEnum.ENGLISH
  }
}

/**
 * Represents the interface for a response from the server.
 */
export interface HTTPServerResponse {
  response: HTTPResponse
  status: {
    code: number
    message?: string
  }
  headers: HTTPHeaders
}

export interface HTTPResponse {
  /**
   * The status code of the response.
   */
  retcode: number

  /**
   * A message associated with the response.
   */
  message: string

  /**
   * The data returned by the server.
   */
  data: unknown
}

/**
 * Represents the base type that can be used for properties in a request body,
 * request header, or request parameter.
 */
export interface Dict<T> {
  [key: string]: T | undefined
}

/**
 * Represents the type that can be used for the parameters of a request.
 */
export type HTTPQueryParams = Dict<number | string | string[] | null>

/**
 * Represents the type that can be used for the headers of a request.
 */
export type HTTPHeaders = Dict<number | string | string[]>

/**
 * Represents the type that can be used for the body of a request.
 */
export type HTTPBody = Dict<number | number[] | string | string[] | null>

