import { getHi3Region } from './hi.helper'
import { GamesEnum, Hoyolab, IGame } from '../hoyolab'
import { HoyoAPIError } from '../../error'
import { HIRecordModule } from './record'

/**
 * Class representing the Honkai Impact 3rd game.
 *
 * @public
 * @class
 * @category Main
 */
export class HonkaiImpact {
  /**
   * The Daily module for the Honkai Impact 3rd game.
   *
   */
  readonly daily: DailyModule

  /**
   * The Redeem module for the Honkai Impact 3rd game.
   *
   * @public
   * @readonly
   */
  readonly redeem: RedeemModule

  /**
   * The `HIRecordModule` object provides an interface to interact with the user record feature in Honkai Star Rails.
   *
   */
  readonly record: HIRecordModule

  /**
   * The cookie used for authentication.
   *
   */
  readonly cookie: ICookie

  /**
   * The request object used to make HTTP requests.
   *
   */
  private request: HTTPRequest

  /**
   * HoyYolab account object
   *
   */
  private _account: IGame | null = null

  /**
   * The UID of the Honkai Impact 3rd account.
   *
   */
  readonly uid: number | null

  /**
   * The region of the Honkai Impact 3rd account.
   *
   */
  readonly region: string | null

  /**
   * The language of the Honkai Impact 3rd account.
   *
   */
  private lang: LanguageEnum

  /**
   * Create a new instance of HonkaiImpact.
   *
   * @param options The options object used to configure the object.
   */
  constructor(options: IHi3Options) {
    const cookie: ICookie =
      typeof options.cookie === 'string'
        ? Cookie.parseCookieString(options.cookie)
        : options.cookie

    this.cookie = cookie

    if (!options.lang) {
      options.lang = Language.parseLang(cookie.mi18nLang)
    }

    // Parse language to prevent language error
    options.lang = Language.parseLang(options.lang)

    this.request = new HTTPRequest(Cookie.parseCookie(this.cookie))
    this.request.setReferer(DEFAULT_REFERER)
    this.request.setLang(options.lang)

    this.uid = options.uid ?? null
    this.region = this.uid !== null ? getHi3Region(this.uid) : null
    this.lang = options.lang

    this.daily = new DailyModule(
      this.request,
      this.lang,
      GamesEnum.HONKAI_IMPACT,
      this.region,
    )
    this.redeem = new RedeemModule(
      this.request,
      this.lang,
      GamesEnum.HONKAI_IMPACT,
      this.region,
      this.uid,
    )
    this.record = new HIRecordModule(
      this.request,
      this.lang,
      this.region,
      this.uid,
    )
  }

  /**
   * Create a new instance of HonkaiImpact using a Hoyolab account.
   * If `uid` is not provided in the `options`, the account with the highest level will be used.
   *
   * @param options The options object used to configure the object.
   * @throws {HoyoAPIError} Error Wnen the CookieTokenV2 is not set.
   * @returns {Promise<HonkaiImpact>} - A promise that resolves with a new HonkaiImpact instance.
   *
   * @remarks
   * If an object is instantiated from this method but options.cookie.cookieTokenV2 is not set,
   * it will throw an error. This method will access an Endpoint that contains a list of game accounts,
   * which requires the cookieTokenV2 option.
   */
  static async create(options: IHi3Options): Promise<HonkaiImpact> {
    try {
      let game: IGame | null = null
      if (typeof options.uid === 'undefined') {
        const hoyolab = new Hoyolab({
          cookie: options.cookie,
        })

        game = await hoyolab.gameAccount(GamesEnum.HONKAI_IMPACT)
        options.uid = parseInt(game.game_uid)
        options.region = getHi3Region(parseInt(game.game_uid))
      }
      const hi = new HonkaiImpact(options)
      hi.account = game
      return hi
    } catch (error: any) {
      throw new HoyoAPIError(error.message, error.code)
    }
  }

  /**
   * Setter for the account property. Prevents from changing the value once set
   * @param game The game object to set as the account.
   */
  public set account(game: IGame | null) {
    if (this.account === null && game !== null) {
      this._account = game
    }
  }

  /**
   * Getter for the account property.
   * @returns {IGame | null} The current value of the account property.
   */
  public get account(): IGame | null {
    return this._account
  }

  /**
   * Retrieves daily information.
   *
   * @alias {@link DailyModule.info | DailyModule.info }
   * @deprecated Use through { @link HonkaiImpact.daily | HonkaiImpact.daily.info() } instead
   */
  dailyInfo() {
    /* c8 ignore next 3 */
    return this.daily.info()
  }

  /**
   *
   * @alias {@link DailyModule.rewards | DailyModule.rewards }
   * @deprecated Use through { @link HonkaiImpact.daily | HonkaiImpact.daily.rewards() } instead
   */
  dailyRewards() {
    /* c8 ignore next 3 */
    return this.daily.rewards()
  }

  /**
   * Fetch reward from daily login based on day
   *
   * @param day number | null
   * @alias {@link DailyModule.reward | DailyModule.reward }
   * @deprecated Use through { @link HonkaiImpact.daily | HonkaiImpact.daily.reward() } instead
   */
  dailyReward(day: number | null = null) {
    /* c8 ignore next 3 */
    return this.daily.reward(day)
  }

  /**
   * Claim current reward
   *
   * @alias {@link DailyModule.claim | DailyModule.claim }
   * @deprecated Use through { @link HonkaiImpact.daily | HonkaiImpact.daily.claim() } instead
   */
  dailyClaim() {
    /* c8 ignore next 3 */
    return this.daily.claim()
  }

  /**
   * Redeem Code
   *
   * @param code string
   * @alias {@link RedeemModule.claim | RedeemModule.claim }
   * @deprecated Use through { @link HonkaiImpact.redeem | HonkaiImpact.redeem.claim() } instead
   */
  redeemCode(code: string) {
    /* c8 ignore next 3 */
    return this.redeem.claim(code)
  }
}

import { GamesEnum } from '../../client/hoyolab'
import { LanguageEnum } from '../../language'
import { HTTPRequest } from '../../request'
import { DAILY_CLAIM_API, DAILY_INFO_API, DAILY_REWARD_API } from '../../routes'
import {
  IDailyClaim,
  IDailyInfo,
  IDailyReward,
  IDailyRewards,
} from './daily.interface'
import { HoyoAPIError } from '../../error'

/**
 * DailyModule class provides methods to interact with Genshin Impact's daily module endpoints.
 *
 * @class
 * @internal
 * @category Module
 */
export class DailyModule {
  private dailyInfoUrl: string
  private dailyRewardUrl: string
  private dailySignUrl: string

  constructor(
    private request: HTTPRequest,
    private lang: LanguageEnum,
    private game: GamesEnum,
    private region: string | null,
  ) {
    this.dailyInfoUrl = DAILY_INFO_API(game)
    this.dailyRewardUrl = DAILY_REWARD_API(game)
    this.dailySignUrl = DAILY_CLAIM_API(game)
  }

  /**
   * Retrieves daily information.
   *
   * @returns {Promise<IDailyInfo>} A promise that resolves to an IDailyInfo object.
   */
  async info(): Promise<IDailyInfo> {
    this.request
      .setQueryParams({
        lang: this.lang,
      })
      .setLang(this.lang)

    const res = await this.request.send(this.dailyInfoUrl)

    if (res.retcode !== 0 || !res.data) {
      throw new HoyoAPIError(
        res.message ??
          'Failed to retrieve data, please double-check the provided UID.',
        res.retcode,
      )
    }

    const data = res.data as IDailyInfo

    if (typeof data?.first_bind === 'undefined' || data?.first_bind === null) {
      data.first_bind = false
    }

    if (typeof data.month_last_day === 'undefined') {
      const today = new Date()
      const lastDayOfMonth = new Date(
        today.getFullYear(),
        today.getMonth() + 1,
        0,
      ).getDate()

      data.month_last_day = today.getDate() === lastDayOfMonth
    }

    if (typeof data.sign_cnt_missed === 'undefined') {
      data.sign_cnt_missed = 0
    }

    if (typeof data.short_sign_day === 'undefined') {
      data.short_sign_day = 0
    }

    if (data.region === '' && this.region) {
      data.region = this.region
    }

    return data
  }

  /**
   * Retrieve daily rewards information.
   *
   * @returns {Promise<IDailyRewards>} A promise that resolves to an IDailyRewards object.
   */
  async rewards(): Promise<IDailyRewards> {
    this.request
      .setQueryParams({
        lang: this.lang,
      })
      .setLang(this.lang)

    const res = await this.request.send(this.dailyRewardUrl)

    if (res.retcode !== 0 || !res.data) {
      throw new HoyoAPIError(
        res.message ??
          'Failed to retrieve data, please double-check the provided UID.',
        res.retcode,
      )
    }

    const data = res.data as IDailyRewards

    if (typeof data.now === 'undefined') {
      data.now = Math.round(new Date().getTime() / 1000).toString()
    }

    if (this.game === GamesEnum.GENSHIN_IMPACT) {
      data.biz = 'hk4e'
    } else if (this.game === GamesEnum.HONKAI_IMPACT) {
      data.biz = 'hk4e'
    } else if (this.game === GamesEnum.HONKAI_STAR_RAIL) {
      data.biz = 'hkrpg'
      /* c8 ignore next 3 */
    } else {
      data.biz = ''
    }
    /* c8 ignore next 3 */

    if (typeof data.resign === 'undefined') {
      data.resign = false
    }

    return data
  }

  /**
   * Get the daily reward for a specific day or the current day
   *
   * @param {number | null} day - The day to retrieve the reward for. If null, retrieve the reward for the current day.
   * @returns {Promise<IDailyReward>} - A promise that resolves with the daily reward for the specified day or the current day
   * @throws {HoyoAPIError} - If the specified day is not a valid date in the current month or if the reward for the specified day is undefined.
   */
  async reward(day: number | null = null): Promise<IDailyReward> {
    const response = await this.rewards()

    if (day === null) {
      /* c8 ignore start */
      const now = response?.now
        ? new Date(parseInt(response.now) * 1000)
        : new Date()
      day = now.getDate()
      /* c8 ignore stop */
    }

    const date = new Date()
    const year = date.getFullYear()
    const month = date.getMonth()
    const daysInMonth = new Date(year, month + 1, 0).getDate()

    if (
      !(day > 0 && day <= daysInMonth) ||
      typeof response.awards[day - 1] === undefined
    ) {
      throw new HoyoAPIError(`${day} is not a valid date in this month.`)
    }

    return {
      month: response.month,
      now: response.now,
      biz: response.biz,
      resign: response.resign,
      award: response.awards[day - 1],
    }
  }

  /**
   * Claim the daily rewards.
   *
   * @returns {Promise<IDailyClaim>} The claim information.
   */
  async claim(): Promise<IDailyClaim> {
    this.request
      .setQueryParams({
        lang: this.lang,
      })
      .setLang(this.lang)

    const response = await this.request.send(this.dailySignUrl, 'POST', 0)

    const info = await this.info()
    const reward = await this.reward()

    /* c8 ignore start */
    if (response.retcode === -5003) {
      return {
        status: response.message,
        code: -5003,
        reward,
        info,
      }
    }

    if (
      (response.data as IDailyClaim | undefined)?.code
        .toString()
        .toLowerCase() === 'ok' &&
      response.retcode === 0
    ) {
      return {
        status: response.message,
        code: 0,
        reward,
        info,
      }
    }

    return {
      status: response.message,
      code: response.retcode,
      reward: null,
      info,
    }
    /* c8 ignore start */
  }
}

